import React from 'react';
import { Switch, Route } from 'react-router-dom';
import './App.css';
import OpinionRegister from "./opinion/OpinionRegister";
import './css/tailwind.css';
import './css/components/buttons.css'
import OpinionList from "./opinion/OpinionList";
import SinglePage from "./stocks/SinglePage";


const App = () => {
  return <>
          <Switch>
              <Route path="/opinionList" component={OpinionList}/>
              <Route path="/opinionRegister" component={OpinionRegister}/>
          </Switch>
          {/*<SinglePage/>*/}
          <OpinionRegister/>
          <OpinionList/>
  </>
}

export default App;
